import { privateAxios } from "./helper";
import { myAxios } from "./helper";

// Create post function
export const createPost = (post) => {
  // console.log(post)
  return privateAxios
    .post(`/api/user/${post.userId}/category/${post.categoryId}/posts`, post)
    .then((response) => response.data);
};

// Load all posts...
export const getAllPost = (pageNumber, pageSize) => {
  return myAxios.get(`/api/posts?pageNumber=${pageNumber}&pageSize=${pageSize}`).then((response)=> response.data);
};
